    data: |
      SELECT ALL * FROM tab0 cor0 WHERE NOT NULL NOT IN ( col0 / cor0.col2 + col1 ) OR col2 + - col1 * col0 * col0 < ( col0 / col0 );
  - name: tab0

outputs:
  - name: q10032.out
    data: |
      24	86	33
      35	97	1
      89	91	82
